import './App.css';

import React, { Component } from 'react'
import Navbar from './Components/Navbar';
import News from './Components/News';
import {
  BrowserRouter as Router,
  Route,
  Routes
} from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <>
        <Router>
          <div>
            <Navbar />
            <Routes>
              <Route exact path="/"> <News country="us" category="general" /> </Route>
              <Route exact path="/business"> <News country="us" category="business" /> </Route>
              <Route exact path="/entertainment"> <News country="us" category="entertainment" /> </Route>
              <Route exact path="/health"> <News country="us" category="health" /> </Route>
              <Route exact path="/education"> <News country="us" category="education" /> </Route>
              <Route exact path="/sports"> <News country="us" category="sports" /> </Route>
              <Route exact path="/science"> <News country="us" category="science" /> </Route>
              <Route exact path="/technology"> <News country="us" category="technology" /> </Route>
            </Routes>
            {/* <News country="us" category="" /> */}
          </div>
        </Router>
      </>
    )
  }
}
